class Solution:
    def maximumValueSum(self, board: List[List[int]]) -> int:
        n=len(board)
        for idx,row in enumerate(board):
            for i,x in enumerate(row):
                row[i]=(x,i)
            board[idx]=sorted(row,reverse=True)[:3]

        def test(a,b,c):
            res=-inf
            for i in range(3):
                for j in range(3):
                    if b[j][1]==a[i][1]:
                        continue
                    for k in range(3):
                        if c[k][1]==a[i][1] or c[k][1]==b[j][1]:
                            continue
                        res=max(res,a[i][0]+b[j][0]+c[k][0])
            return res

        res=-inf
        for i in range(n-2):
            for j in range(i+1,n-1):
                for k in range(j+1,n):
                    res=max(test(board[i],board[j],board[k]),res)
        return res
